import React from 'react';
import { Card, CardMedia, CardContent, Typography, Grid } from '@mui/material';

const foodItems = [
  {
    id: 1,
    name: 'Veg Tiffin',
    image: '/images/veg_tiffin.jpg', // Local image path
    description: 'Delicious and healthy Veg Tiffin.',
  },
  //{
    //id: 2,
    //name: 'Non-Veg Thali',
    //image: '/images/non_veg_thali.jpg', // Local image path
    //description: 'Rich in proteins and flavor Non-Veg Thali.',
  //},
];


const FoodCars = () => {
  return (
    <div style={{ textAlign: 'center', padding: '5px' }}>
      {/* Welcome Message */}
      <Typography variant="h4" component="h1" gutterBottom>
        Welcome to Tiffin Service
      </Typography>

      {/* Food Items */}
      <Grid container spacing={4} sx={{ padding: 4 }}>
        {foodItems.map((item) => (
          <Grid item xs={12} sm={6} md={4} key={item.id}>
            <Card>
              {/* Image rendering check */}
              <CardMedia
                component="img"
                height="140"
                image={item.image}
                alt={item.name}
                onError={() => console.log(`Failed to load image for ${item.name}`)} // Error handling for images
              />
              <CardContent>
                <Typography variant="h6">{item.name}</Typography>
                <Typography variant="body2" color="text.secondary">
                  {item.description}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default FoodCars;
